import React, { useState, useEffect } from 'react';
import DatabricksService, { SymptomRequest, HealthcareRecommendation } from '../services/databricksService';
import LocationService, { Location } from '../services/locationService';

const DatabricksTest: React.FC = () => {
  const [status, setStatus] = useState<any>(null);
  const [connectionTest, setConnectionTest] = useState<boolean | null>(null);
  const [location, setLocation] = useState<Location | null>(null);
  const [loading, setLoading] = useState(false);
  const [testResults, setTestResults] = useState<string[]>([]);
  const [recommendation, setRecommendation] = useState<HealthcareRecommendation | null>(null);

  // Sample symptom data for testing
  const [symptoms, setSymptoms] = useState({
    symptoms: ['headache', 'fever'],
    severity: 'moderate' as const,
    duration: '2 days',
    description: 'Persistent headache with mild fever, started two days ago'
  });

  const addTestResult = (result: string) => {
    setTestResults(prev => [...prev, `${new Date().toLocaleTimeString()}: ${result}`]);
  };

  useEffect(() => {
    // Get service status on mount
    const serviceStatus = DatabricksService.getStatus();
    setStatus(serviceStatus);
    addTestResult(`Service Status: ${serviceStatus.configured ? 'Configured' : 'Not configured'}`);

    // Get location for testing
    getCurrentLocation();
  }, []);

  const getCurrentLocation = async () => {
    try {
      const loc = await LocationService.getCurrentLocation();
      setLocation(loc);
      addTestResult(`Location acquired: ${loc.city}, ${loc.state}`);
    } catch (error) {
      addTestResult(`Location failed, using IP fallback`);
      try {
        const ipLoc = await LocationService.getLocationFromIP();
        setLocation(ipLoc);
        addTestResult(`IP location: ${ipLoc.city}, ${ipLoc.state}`);
      } catch {
        addTestResult(`All location methods failed`);
      }
    }
  };

  const testConnection = async () => {
    setLoading(true);
    addTestResult('üß™ Testing Databricks connection...');

    try {
      const isConnected = await DatabricksService.testConnection();
      setConnectionTest(isConnected);
      addTestResult(`‚úÖ Connection test: ${isConnected ? 'SUCCESS' : 'FAILED'}`);
    } catch (error: any) {
      setConnectionTest(false);
      addTestResult(`‚ùå Connection failed: ${error.message}`);
    } finally {
      setLoading(false);
    }
  };

  const testSymptomAnalysis = async () => {
    if (!location) {
      addTestResult('‚ùå Need location for symptom analysis');
      return;
    }

    setLoading(true);
    addTestResult('üß™ Testing symptom analysis...');

    try {
      const request: SymptomRequest = {
        ...symptoms,
        location,
        userProfile: {
          age: 30,
          gender: 'not specified',
          medicalHistory: [],
          allergies: [],
          medications: [],
          chronicConditions: []
        }
      };

      const result = await DatabricksService.analyzeSymptoms(request);
      setRecommendation(result);
      addTestResult(`‚úÖ Analysis complete: ${result.recommendedCareType} (${result.urgency})`);
      addTestResult(`üìä Confidence: ${(result.confidence * 100).toFixed(1)}%`);
    } catch (error: any) {
      addTestResult(`‚ùå Symptom analysis failed: ${error.message}`);
    } finally {
      setLoading(false);
    }
  };

  const testProviderRecommendations = async () => {
    if (!location) {
      addTestResult('‚ùå Need location for provider recommendations');
      return;
    }

    setLoading(true);
    addTestResult('üß™ Testing provider recommendations...');

    try {
      const result = await DatabricksService.getProviderRecommendations(
        'chest pain',
        location,
        'urgent'
      );
      addTestResult(`‚úÖ Provider recommendations: ${result.recommended_types.join(', ')}`);
      addTestResult(`üîç Search keywords: ${result.search_keywords.join(', ')}`);
    } catch (error: any) {
      addTestResult(`‚ùå Provider recommendations failed: ${error.message}`);
    } finally {
      setLoading(false);
    }
  };

  const testTravelHealth = async () => {
    setLoading(true);
    addTestResult('üß™ Testing travel health advice...');

    try {
      const result = await DatabricksService.getTravelHealthAdvice(
        'Thailand',
        ['diabetes', 'hypertension'],
        '2 weeks'
      );
      addTestResult(`‚úÖ Travel advice generated`);
      addTestResult(`üíâ Vaccinations: ${result.vaccinations.length} recommended`);
      addTestResult(`üíä Medications: ${result.medications.length} suggested`);
    } catch (error: any) {
      addTestResult(`‚ùå Travel health advice failed: ${error.message}`);
    } finally {
      setLoading(false);
    }
  };

  const runAllTests = async () => {
    setTestResults([]);
    addTestResult('üöÄ Starting comprehensive Databricks tests...');

    await testConnection();

    if (connectionTest !== false) {
      setTimeout(() => testSymptomAnalysis(), 1000);
      setTimeout(() => testProviderRecommendations(), 3000);
      setTimeout(() => testTravelHealth(), 5000);
    }
  };

  return (
    <div style={{ padding: '20px', maxWidth: '1000px', margin: '0 auto' }}>
      <h2>üîó Databricks Healthcare Agent Test</h2>

      <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px', marginBottom: '20px' }}>
        <div>
          <h3>üìä Service Status</h3>
          {status && (
            <div style={{
              backgroundColor: status.configured ? '#d4edda' : '#f8d7da',
              padding: '12px',
              borderRadius: '4px'
            }}>
              <p><strong>Configured:</strong> {status.configured ? '‚úÖ Yes' : '‚ùå No'}</p>
              <p><strong>Workspace:</strong> {status.workspace || 'Not set'}</p>
              <p><strong>Endpoint:</strong> {status.endpoint || 'Not set'}</p>
              <p><strong>Token:</strong> {status.hasToken ? '‚úÖ Present' : '‚ùå Missing'}</p>
            </div>
          )}

          <h3>üåç Test Location</h3>
          {location ? (
            <div style={{ backgroundColor: '#d4edda', padding: '12px', borderRadius: '4px' }}>
              <p><strong>City:</strong> {location.city}</p>
              <p><strong>State:</strong> {location.state}</p>
              <p><strong>Coordinates:</strong> {location.lat.toFixed(4)}, {location.lng.toFixed(4)}</p>
            </div>
          ) : (
            <p style={{ color: '#6c757d' }}>Loading location...</p>
          )}
        </div>

        <div>
          <h3>üß™ Test Controls</h3>
          <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
            <button 
              onClick={runAllTests}
              disabled={loading}
              style={{
                backgroundColor: '#007bff',
                color: 'white',
                border: 'none',
                padding: '12px',
                borderRadius: '6px',
                cursor: loading ? 'not-allowed' : 'pointer'
              }}
            >
              {loading ? 'üîÑ Testing...' : 'üöÄ Run All Tests'}
            </button>

            <button 
              onClick={testConnection}
              disabled={loading}
              style={{
                backgroundColor: '#28a745',
                color: 'white',
                border: 'none',
                padding: '8px',
                borderRadius: '4px',
                cursor: loading ? 'not-allowed' : 'pointer'
              }}
            >
              üîó Test Connection
            </button>

            <button 
              onClick={testSymptomAnalysis}
              disabled={loading || !location}
              style={{
                backgroundColor: '#17a2b8',
                color: 'white',
                border: 'none',
                padding: '8px',
                borderRadius: '4px',
                cursor: (loading || !location) ? 'not-allowed' : 'pointer'
              }}
            >
              ü©∫ Test Symptoms
            </button>
          </div>

          <h3>ü©∫ Test Symptoms</h3>
          <div style={{ fontSize: '12px', backgroundColor: '#f8f9fa', padding: '8px', borderRadius: '4px' }}>
            <p><strong>Symptoms:</strong> {symptoms.symptoms.join(', ')}</p>
            <p><strong>Severity:</strong> {symptoms.severity}</p>
            <p><strong>Duration:</strong> {symptoms.duration}</p>
          </div>
        </div>
      </div>

      <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px' }}>
        <div>
          <h3>üìã Test Results</h3>
          <div style={{
            backgroundColor: '#f8f9fa',
            border: '1px solid #dee2e6',
            borderRadius: '4px',
            padding: '12px',
            height: '300px',
            overflowY: 'auto',
            fontFamily: 'monospace',
            fontSize: '12px'
          }}>
            {testResults.map((result, index) => (
              <div key={index} style={{ marginBottom: '4px' }}>
                {result}
              </div>
            ))}
          </div>
        </div>

        <div>
          <h3>üéØ Healthcare Recommendation</h3>
          {recommendation ? (
            <div style={{
              backgroundColor: '#e7f3ff',
              padding: '12px',
              borderRadius: '6px',
              border: '1px solid #b3d9ff',
              maxHeight: '300px',
              overflowY: 'auto'
            }}>
              <h4>Care Type: {recommendation.recommendedCareType}</h4>
              <p><strong>Urgency:</strong> {recommendation.urgency}</p>
              <p><strong>Confidence:</strong> {(recommendation.confidence * 100).toFixed(1)}%</p>
              <p><strong>Reasoning:</strong> {recommendation.reasoning}</p>

              <h5>Recommendations:</h5>
              <ul>
                {recommendation.recommendations.map((rec, i) => (
                  <li key={i} style={{ fontSize: '12px' }}>{rec}</li>
                ))}
              </ul>

              <h5>Next Steps:</h5>
              <ul>
                {recommendation.next_steps.map((step, i) => (
                  <li key={i} style={{ fontSize: '12px' }}>{step}</li>
                ))}
              </ul>

              {recommendation.when_to_seek_emergency_care.length > 0 && (
                <>
                  <h5 style={{ color: '#dc3545' }}>‚ö†Ô∏è Seek Emergency Care If:</h5>
                  <ul>
                    {recommendation.when_to_seek_emergency_care.map((warning, i) => (
                      <li key={i} style={{ fontSize: '12px', color: '#dc3545' }}>{warning}</li>
                    ))}
                  </ul>
                </>
              )}
            </div>
          ) : (
            <p style={{ color: '#6c757d' }}>No recommendation yet</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default DatabricksTest;
